			int N = Integer.parseInt(br.readLine());
			int[][] map=new int[N][N];
			for(int i=0;i<N;i++) {
				st = new StringTokenizer(br.readLine());
				for(int j=0;j<N;j++) {
					map[i][j]=Integer.parseInt(st.nextToken());
				}
			}
			int ans=0;
			//열로 검사해서 0,1이면 그냥 넘어가기!!!!
			for(int i=0;i<N;i++) {
				int n=0,s=0;
				for(int j=0;j<N;j++) {
					if(map[j][i]==1) {
						n++;
					}else if(map[j][i]==2) {
						s++;
					}
				}
				if(n+s<=1) {
					//여기는 그냥 넘기기
				}else {
					ans++;
					if(n==s) {
						ans++;
					}
				}
			}
			
			System.out.println("#" + tc + " "+ans);
